nternetezhess.", "unLocalized": "", "def": "A lassított sebességű folytatást választottad, így néhány alkalmazás és a böngészés korlátozottan lesz elérhető. Netinfo alkalmazásban bármikor választhatsz a kiegészítő adatcsomagok közül annak érdekében, hogy számlazárásig az eredeti feltételekkel internetezhess."}, "Description": {"eng": "This tariff has 4 GB of mobile internet included in each monthly billing period. If you need more, you can choose a great value extra data pack from below to stay connected at full speed.", "hun": "Ezzel a csomaggal 4 GB adat áll rendelkezésedre minden számlázási ciklusban. Ha többre van szükséged, válassz kiegészítő adat opcióink közül.", "unLocalized": "", "def": "Ezzel a csomaggal 4 GB adat áll rendelkezésedre minden számlázási ciklusban. Ha többre van szükséged, válassz kiegészítő adat opcióink közül."}, "Active": "false", "Warning_percent": "80", "Id": "54388", "Throttling_limit_mb": "4096", "Online_selfcare_id": "", "PSMCodes": {"Activation": ""}, "UnlimitedContentPackages": ["UCP67695", "UCP67694", "UCP67693", "UCP67696"], "Type": "IOYM", "Upgrade_offer_ids": [], "Featured": "false", "Warning_text": {"eng": "You have used 80% of your mobile internet allowance. When you reach 100%, you will need an extra data pack to continue using mobile internet at full speed before the start of your next bill cycle. You can even choose a great value extra data pack now - before you run out!", "hun": "A csomagodban foglalt belföldi adatmennyiség 80%-át elhasználtad. Ha eléred a 100%-ot, annak érdekében, hogy számlazárásig változatlan feltételekkel internetezhess, válassz az alábbi kiegészítő adatcsomagok közül.", "unLocalized": "", "def": "A csomagodban foglalt belföldi adatmennyiség 80%-át elhasználtad. Ha eléred a 100%-ot, annak érdekében, hogy számlazárásig változatlan feltételekkel internetezhess, válassz az alábbi kiegészítő adatcsomagok közül."}}', 12);
