INSERT INTO oscc_object VALUES (DEFAULT, '61365', '{"Id": "61365", "Online_selfcare_id": "", "Active": "false", "Description": {"eng": "Upload your code in the „Netre Szomjazol?” game and we give 50 MB extra data for domestic use, which can be consumed until this midnight. We are going to send SMS notification, if you run out of it. You can collect max 3x50 MB per day.", "hun": "Töltsd fel kódod a „Netre szomjazol?” játékban, és kódonként 50 MB-ot jóváírunk egyenlegeden, melyet ma éjfélig használhatsz fel belföldön. SMS-ben értesítünk, ha promóciós adatforgalmad elfogy, egy nap maximum 3x50 MB-ot gyűjthetsz!", "unLocalized": "", "def": "Töltsd fel kódod a „Netre szomjazol?” játékban, és kódonként 50 MB-ot jóváírunk egyenlegeden, melyet ma éjfélig használhatsz fel belföldön. SMS-ben értesítünk, ha promóciós adatforgalmad elfogy, egy nap maximum 3x50 MB-ot gyűjthetsz!"}, "Refill_ids": "", "Name": {"eng": "Netre szomjazol data", "hun": "Netre szomjazol adat", "unLocalized": "", "def": "Netre szomjazol adat"}, "Price": "0", "PSMCodes": {"Activation": ""}, "Type": "Emergency", "Data_usage_mb": "50", "Featured": "false"}', 11);
INSERT INTO oscc_object VALUES (DEFAULT, '61364', '{"Id": "61364", "Online_selfcare_id": "", "Active": "false", "Description": {"eng": "1 GB extra data is the monthly prize of the „Netre szomjazol?” game, which is for domestic use and can be consumed in 30 days or until the next billing cycle after the activation. We are going to send SMS notification, if you run out of it.", "hun": "A „Netre szomjazol?” játékban heti nyereményed 1GB adatforgalom, mely 30 napig, illetve nyeremény aktiválását követő számlázási ciklus végéig használható fel belföldön.", "unLocalized": "", "def": "A „Netre szomjazol?” játékban heti nyereményed 1GB adatforgalom, mely 30 napig, illetve nyeremény aktiválását követő számlázási ciklus végéig használható fel belföldön."}, "Refill_ids": "", "Name": {"eng": "Netre szomjazol 1 GB", "hun": "Netre szomjazol 1 GB ", "unLocalized": "", "def": "Netre szomjazol 1 GB "}, "Price": "0", "PSMCodes": {"Activation": ""}, "Type": "Multicycle", "Data_usage_mb": "1024", "Featured": "false"}', 11);
