INSERT INTO oscc_object VALUES (DEFAULT, '62850', '{"Id": "62850", "Online_selfcare_id": "", "Active": "false", "Description": {"eng": "This extra data pack will give you an additional 3GB of mobile internet (on top of the data already included in your tariff or Automatikus PluszAdat option) for 2787 Ft. It will be activated every month at the start of your billing period so you don''t have to worry about purchasing extra data every month - after you run out! Cancelation of the option within your contract period entails a contractual fee, as described in GTC 12.6.12, which equals to the amount of discount granted in the monthly subscription fee of the preferential option, as compared to the monthly fee of the Plus Data option included in your tariff. After the fixed term contract expires you can opt out without any additional fee.", "hun": "Ezzel a kiegészítő adatopcióval 3GB-tal növelheted az adatforgalmadat havi 2782 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Az opciót a tarifádban vállalt előfizetési idő végéig csak kötbér ellenében mondhatod le, ami az ÁSZF 12.6.12 pontjában írtak szerint a kedvezményes opció havi előfizetési díjának a tarifáddal megvásárolható Plusz Adat havi díjához képest számított, igénybe vett kedvezménnyel azonos mértékű. A határozott idő lejártát követően a kedvezményes opciót kötbér nélkül bármikor lemondhatod.", "unLocalized": "", "def": "Ezzel a kiegészítő adatopcióval 3GB-tal növelheted az adatforgalmadat havi 2782 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Az opciót a tarifádban vállalt előfizetési idő végéig csak kötbér ellenében mondhatod le, ami az ÁSZF 12.6.12 pontjában írtak szerint a kedvezményes opció havi előfizetési díjának a tarifáddal megvásárolható Plusz Adat havi díjához képest számított, igénybe vett kedvezménnyel azonos mértékű. A határozott idő lejártát követően a kedvezményes opciót kötbér nélkül bármikor lemondhatod."}, "Refill_ids": "", "Name": {"eng": "PluszAdat 3GB (Discount)", "hun": "Kedvezményes Megújuló PluszAdat 3GB", "unLocalized": "", "def": "Kedvezményes Megújuló PluszAdat 3GB"}, "Price": "2788", "PSMCodes": {"Deactivation": "XPLUSZ3GBB-H", "Activation": "PLUSZ3GBB-H"}, "Type": "Recurring", "Data_usage_mb": "3072", "Featured": "false"}', 11);
