INSERT INTO oscc_object VALUES (DEFAULT, 'O_PQREF_635c59', '{"Id": "O_PQREF_635c59", "Active": "true", "Description": {"eng": "This extra data pack will give you an additional 300MB of shared mobile internet for 750 Ft which you can use until your bill cycle, with the same conditions as your tariff. In case you have also contracted a MultiNet Supreme tariff, you will be able to share this extra data bundle between both your devices!", "hun": "Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!", "unLocalized": "", "def": "Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!"}, "Name": {"eng": "Shared PluszAdat 300 MB", "hun": "Osztható PluszAdat 300 MB", "unLocalized": "", "def": "Osztható PluszAdat 300 MB"}, "PSMCodes": {"Activation": "TOLT 300MB"}, "Type": "One Time", "Price": "750"}', 7);
INSERT INTO oscc_object VALUES (DEFAULT, '66975', '{"Id": "66975", "Active": "true", "Description": {"eng": "This extra data pack will give you an additional 300MB of shared mobile internet in each monthly billing period (on top of the data already included in your tariff or Automatikus PluszAdat option) for 500 Ft. It will be activated every month at the start of your billing period so you don''t have to worry about purchasing extra data every month - after you run out! In case you have also contracted a MultiNet Supreme tariff, you will be able to share this extra data bundle between both your devices! You can use this extra data pack with the same conditions as your tariff.", "hun": "Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.", "unLocalized": "", "def": "Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod."}, "Name": {"eng": "Shared Recurring PluszAdat 300MB", "hun": "Osztható Megújuló PluszAdat 300 MB", "unLocalized": "", "def": "Osztható Megújuló PluszAdat 300 MB"}, "PSMCodes": {"Deactivation": "XPLUSZ300MB-O-M", "Activation": "PLUSZ300MB-O-M"}, "Type": "recurringPR", "Price": "500"}', 7);
